const Foodlist = ({ items , title}) => {
    return ( 
        <div>
        <h1> { title } </h1>
        {
            items.map( (food)=>{ return(
                <div className="food">
                <img src="food.pic" alt="" />
                <h2>{ food.foodName } </h2>
                <h6>{ food.price }</h6>
                </div>
            )

            } )
        }
        </div>
     );
}
 
export default Foodlist;
